	this.cleanFalses = function(keyMap) {
		var returnMap = {};
		_.forEach(keyMap, function(value, key) {
			if (value) {
				returnMap[key] = true;
			}
		});
		return returnMap;
	}

	this.loadingAirports = false;
	this.getAirports = function(airport) {
		var that = this;
		that.loadingAirports = true;

		airport = airport.toLowerCase();
		let matchingAirports = allAirports.filter(x => x.iata_code.toLowerCase() == airport || x.name.toLowerCase().includes(airport) || x.keywords.toLowerCase().includes(airport) || x.municipality.toLowerCase().includes(airport));

		

		matchingAirports = matchingAirports.sort((a, b) => {
			function hasKeywordThatStartsWith(keywords, airportString) {
				keywords = keywords.split(',');

				return Boolean(keywords.find(keyword => keyword.trim().startsWith(airportString)));
			}

			// now sort where iata matches go to top
			// then sort where name starts with
			// then sort where municipality starts with
			// then sort where keywords starts with
			// then sort alphabetically

			if (a.iata_code.toLowerCase() == airport) {
				return -1;
			} else if (b.iata_code.toLowerCase() == airport) {
				return 1;
			} else if (a.name.toLowerCase().startsWith(airport)) {
				return -1;
			} else if (b.name.toLowerCase().startsWith(airport)) {
				return 1;
			} else if (a.municipality.toLowerCase().startsWith(airport)) {
				return -1;
			} else if (b.municipality.toLowerCase().startsWith(airport)) {
				return 1;
			} else if (hasKeywordThatStartsWith(a.keywords.toLowerCase(), airport)) {
				return -1
			} else if (hasKeywordThatStartsWith(b.keywords.toLowerCase(), airport)) {
				return 1
			} else {
				return a.name.toLowerCase() < b.name.toLowerCase() ? -1 : 1;
			}
		}).slice(0, 4).map(x => ({
			name: x.name,
			iata: x.iata_code
		}));

		that.loadingAirports = false;

		return matchingAirports;
	};

